import React from 'react';
import Post from '../Post-Component/Post';
import Share from '../Share/Share';
import './Feed.css';
import {Posts} from '../../Data'

function Feed() {
    return (
        <div className="feedContainer">
            <div className="feedWrapper">
                <Share/>
                {Posts.map((post)=>{
                    return(<Post post={post}/>)
                })}
            </div>

        </div>
    )
}

export default Feed
